import React, { useState, useEffect } from 'react';
import '../styles/ComingSoon.css';

const SimpleComingSoon = () => {
  const [email, setEmail] = useState('');
  const [isSubmitted, setIsSubmitted] = useState(false);
  const [days, setDays] = useState(0);
  
  useEffect(() => {
    // Simple countdown - just days
    const launchDate = new Date();
    launchDate.setDate(launchDate.getDate() + 30);
    const daysLeft = Math.floor((launchDate - new Date()) / (1000 * 60 * 60 * 24));
    setDays(daysLeft);
  }, []);
  
  const handleSubmit = (e) => {
    e.preventDefault();
    setIsSubmitted(true);
    setEmail('');
    setTimeout(() => setIsSubmitted(false), 3000);
  };
  
  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100">
      <div className="w-full max-w-md p-8 mx-4 bg-white rounded-lg shadow-md text-center">
        <h1 className="text-3xl font-bold mb-4 text-blue-600">Coming Soon</h1>
        
        <p className="text-gray-600 mb-6">
          Our new feature will be ready in {days} days!
        </p>
        
        <div className="bg-gray-100 p-6 rounded-lg mb-6">
          <h2 className="text-lg font-medium mb-4">Get Notified When We Launch</h2>
          
          {isSubmitted ? (
            <div className="p-3 bg-green-100 text-green-700 rounded-md">
              Thank you! We'll notify you when we launch.
            </div>
          ) : (
            <form onSubmit={handleSubmit}>
              <div className="mb-4">
                <input
                  type="email"
                  placeholder="Enter your email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                  className="w-full p-3 border border-gray-300 rounded-md"
                />
              </div>
              <button 
                type="submit" 
                className="w-full p-3 bg-blue-600 text-white rounded-md hover:bg-blue-700"
              >
                Notify Me
              </button>
            </form>
          )}
        </div>
        
        <p className="text-sm text-gray-500">
          Contact us at <a href="mailto:info@example.com" className="text-blue-600">info@example.com</a>
        </p>
        
        <button 
          onClick={() => window.history.back()}
          className="mt-4 px-4 py-2 border border-gray-300 rounded-md text-gray-600 hover:bg-gray-100"
        >
          Back
        </button>
      </div>
    </div>
  );
};

export default SimpleComingSoon;
